<?php

class CNGeoIP {

    function __construct() {
	$this->is_valid = false;
	$this->error_message = "";
	$this->filename_binary_tree = dirname(__FILE__) . "/cngeoip.dat";
	$this->fp_binary_tree = fopen($this->filename_binary_tree, 'r');
	if ( !$this->fp_binary_tree ) {
	    $this->error_message = "Can't open binary tree file {$this->filename_binary_tree}";
	    return false;
	}
	$data = fread($this->fp_binary_tree, 4);
	$unp = unpack('Ndata', $data);
	if ( (($unp['data'] >> 8) & 0xffffff) != 0xcd301b ) {
	    $this->error_message = "Invalid datafile signature \"".(($unp['data'] >> 8) & 0xffffff)."\"";
	    return false;
	}
	if ( (($unp['data']) & 0xff) != 0x05 ) {
	    $this->error_message = "Incompatible datafile version \"".(($unp['data']) & 0xff)."\"";
	    return false;
	}
	$this->level_size = array();
	for(;;) {
	    $data = fread($this->fp_binary_tree, 1);
	    $unp = unpack('Cdata', $data);
	    $hi = ($unp['data']>>4) & 0x0f;
	    $lo = $unp['data'] & 0x0f;
	    $this->level_size[] = $hi;
	    if ( $hi == 0 )
		break;
	    $this->level_size[] = $lo;
	    if ( $lo == 0 )
		break;
	}
	$this->start_offset = ftell($this->fp_binary_tree);
	$this->is_valid = true;
    }


    function __destruct() {
	fclose($this->fp_binary_tree);
    }


    function get_place_by_ip($ip) {
	if ( !$this->is_valid )
	    return false;

	$ipint = ip2long($ip);
	$shift = 32;
	$offset = $this->start_offset;

	for($l=0; $l<sizeof($this->level_size); $l++) {
	    $shift -= $this->level_size[$l];
	    $index = (($ipint>>$shift)) & ((1<<$this->level_size[$l])-1);
	    $tell = $offset+$index*4;
	    fseek($this->fp_binary_tree, $tell, 0);
	    $data = fread($this->fp_binary_tree, 4);
	    $unp = unpack('Ndata',$data);
	    $offset = $unp['data'] & 0xffffffff;
	    if ( $offset & 0x80000000 ) {
		$tell = $offset & 0x7fffffff;
		fseek($this->fp_binary_tree, $tell, 0);
		$data = fread($this->fp_binary_tree, 2);
		$unp = unpack('nlen', $data);
		$length = $unp['len'] & 0xffff;
		if ( !$length )
		    return "";
		$info = fread($this->fp_binary_tree, $length);
		return $info;
	    }
	}
	return false;
    }

    function get_description_by_ip($ip) {
	if ( !$this->is_valid )
	    return false;
        return $this->get_description_by_place($this->get_place_by_ip($ip));
    }

    function get_description_by_place($place) {
	if ( !$this->is_valid )
	    return false;
	if ( preg_match("/^\/.*$/", $place) ) {
	    $results = array();
	    while ( preg_match("/^(\/[^\s]+)*\/[^\s]+$/", $place, $matches)) {
			$results[] = $GLOBALS['cngeo5dict'][$place];
			$place = isset($matches[1]) ? $matches[1] : null;
	    }
	}
	else {
	    $results = array('special'=>$place);
	}
	return $results;
    }


    private $is_valid;
    function is_valid() {
	return $this->is_valid;
    }

    private $error_message;
    function get_error() {
	return $this->error_message;
    }

    private $level_size;
    private $start_offset;

    private $fp_binary_tree;
    private $dbh;

    private $filename_binary_tree;

}


